import { ConfigProvider } from 'antd';
import Layout from '../Components/Layout';


function MyApp({ Component, pageProps }) {

  return <ConfigProvider>
    <Layout>
      <Component {...pageProps} />
    </Layout>
  </ConfigProvider>
}

